----varaus

---ensin toimisteille (mistä haetaan) tehdyt varaukset:
declare @lkm int
set @lkm = 0
declare @alkupvm date
set @alkupvm = '2020-06-01'
declare @rand_pvm date

while @lkm <= 3500
begin
	set @rand_pvm = convert(date,DATEADD(DAY, RAND(CHECKSUM(NEWID()))*(1+DATEDIFF(DAY, @alkupvm,convert(date, '2023-06-27', 23))), @alkupvm),23) ---satunnainen päivä varaukselle
	FLOOR(RAND()*(2000-1+1))+1, --asiakkaan id
	'liike', --varaustyyppi mobiili tai liike
	--FLOOR(RAND()*(10-1+1))+1, -- liikkeen_id
	FLOOR(RAND()*(60-1+1))+1, -- myyjän id
	@rand_pvm, --varauksen päivämäärä
	dateadd(dd,30, @rand_pvm), --laskun eräpäivä
	dateadd(dd, FLOOR(RAND()*(33-27+1))+27,@rand_pvm),--laskun maksupäivämäärä UPDATE
	NULL,
	24)
	set @lkm += 1
end
go


--sitten itsepalvelunoutopisteille:
declare @lkm int
set @lkm = 0
declare @alkupvm date
set @alkupvm = '2020-06-01'
declare @rand_pvm date

while @lkm <= 4500
begin
	set @rand_pvm = convert(date,DATEADD(DAY, RAND(CHECKSUM(NEWID()))*(1+DATEDIFF(DAY, @alkupvm,convert(date, '2023-06-27', 23))), @alkupvm),23) ---satunnainen päivä varaukselle
	FLOOR(RAND()*(2000-1+1))+1, --asiakkaan id
	'mobiili', --varaustyyppi mobiili tai liike
	--FLOOR(RAND()*(50-11+1))+11, -- liikkeen_id
	NULL, -- myyjän id
	@rand_pvm, --varauksen päivämäärä
	dateadd(dd,30, @rand_pvm), --laskun eräpäivä
	dateadd(dd, FLOOR(RAND()*(33-27+1))+27, @rand_pvm),--laskun maksupäivämäärä UPDATE
	NULL,
	24)
	set @lkm += 1
end
go


update varaus set maksu_pvm ='9999-12-31' where maksu_pvm > '2023-06-27'


---varausrivi
--- varausrivit, jotka pitää olla liikkeisiin
declare @lkm int ---muuttuja varausrivien generoimiseen
set @lkm = 0
declare @v_id int
declare @alku_pvm date
declare @paikka int
while @lkm <= 15000 --- generoidaan 15000 varausriviä liikkeisiin
begin
	set @v_id = FLOOR(RAND()*(3501-1+1))+1 ----joku liikkeeseen tehdustä varauksista
	set @alku_pvm = (select varaus_pvm from varaus where varaus_id = @v_id)
	set @paikka = FLOOR(RAND()*(10-1+1))+1
	@v_id, ---varaus, johon varausrivi liittyy
	FLOOR(RAND()*(250-1+1))+1,----tuote_yksilö_id, liikkeestä haettavat
	convert(date,dateadd(dd, FLOOR(RAND()*(14-0+1))+0, @alku_pvm),23), -- varauksen alku
	convert(date,DATEADD(dd,	FLOOR(RAND()*(30-15+1))+15,@alku_pvm),23), --varauksen loppu
	convert(date,DATEADD(dd,	FLOOR(RAND()*(31-15+1))+15,@alku_pvm),23), ----palautuspaiva, päivitä 27.6.2023 jälkeiset -> NULL (oletetaan että kaikki palautetaan 3pv ennen -1pv jälkeen vuokrauspäivän
	@paikka,
	@paikka)
	set @lkm += 1
end
go
---- muut kulkuvälineet: voi noutaa liikkeestä tai itsepalvelupisteestä, pitää palauttaa saman kaupungin pisteeseen
declare @lkm int ---muuttuja varausrivien generoimiseen
set @lkm = 0
declare @v_id int
declare @alku_pvm date
declare @paikka int
while @lkm <= 20000 --- generoidaan 20000 varausriviä muihin toimipisteisiin
begin
	set @v_id = FLOOR(RAND()*(8002-3502+1))+3502 ----joku ei-liikkeeseen tehdystä varauksista (joissa siis voi olla mikä tahansa kulkupeli)
	set @alku_pvm = (select varaus_pvm from varaus where varaus_id = @v_id)
	set @paikka = FLOOR(RAND()*(50-1+1))+1
	@v_id, ---varaus, johon varausrivi liittyy
	FLOOR(RAND()*(500-251+1))+251,----tuote_yksilö_id
	convert(date,dateadd(dd, FLOOR(RAND()*(14-0+1))+0, @alku_pvm),23), -- varauksen alku
	convert(date,DATEADD(dd, FLOOR(RAND()*(30-15+1))+15,@alku_pvm),23), --varauksen loppu
	convert(date,DATEADD(dd, FLOOR(RAND()*(31-15+1))+15,@alku_pvm),23), ----palautuspaiva, päivitä 27.6.2023 jälkeiset -> NULL (oletetaan että kaikki palautetaan 3pv ennen -1pv jälkeen vuokrauspäivän
	@paikka,
	(select top 1 toimipiste_id from toimipiste where kaupunki IN (select kaupunki from toimipiste where toimipiste_id = 2) order by newid() ))
	set @lkm += 1
end
go

